import { generateUtilityClass, generateUtilityClasses } from '../className';
export function getTabUtilityClass(slot) {
  return generateUtilityClass('JoyTab', slot);
}
const tabListClasses = generateUtilityClasses('JoyTab', ['root', 'disabled', 'focusVisible', 'selected', 'horizontal', 'vertical', 'colorPrimary', 'colorNeutral', 'colorDanger', 'colorInfo', 'colorSuccess', 'colorWarning', 'variantPlain', 'variantOutlined', 'variantSoft', 'variantSolid']);
export default tabListClasses;
